import React, { useEffect, useState } from 'react';
import api from '../../../utils/api';

export default function Payments() {
  const [payments, setPayments] = useState([]);
  const [amount, setAmount] = useState('');
  const [month, setMonth] = useState('');
  const [loading, setLoading] = useState(true);
  const [paying, setPaying] = useState(false);
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchPayments();
  }, []);

  const fetchPayments = () => {
    setLoading(true);
    api.get('/payments/me')
      .then(res => {
        setPayments(res.data);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  };

  const handlePay = async (e) => {
    e.preventDefault();
    setMessage('');
    if (!amount || !month) {
      setMessage('Please enter amount and month');
      return;
    }
    setPaying(true);
    try {
      await api.post('/payments/pay', { amount: Number(amount), month });
      setMessage('Payment successful!');
      setAmount('');
      setMonth('');
      fetchPayments();
    } catch (err) {
      setMessage(err.response?.data?.message || 'Payment failed');
    }
    setPaying(false);
  };

  return (
    <div>
      <h3>Maintenance Payments</h3>
      <form className="mb-4" onSubmit={handlePay}>
        <div className="mb-3">
          <label>Amount</label>
          <input
            type="number"
            className="form-control"
            value={amount}
            onChange={e => setAmount(e.target.value)}
            min="0"
            required
          />
        </div>
        <div className="mb-3">
          <label>Month (e.g., 2024-06)</label>
          <input
            type="text"
            className="form-control"
            value={month}
            onChange={e => setMonth(e.target.value)}
            placeholder="YYYY-MM"
            pattern="^\d{4}-(0[1-9]|1[0-2])$"
            required
          />
        </div>
        {message && <div className="mb-3 text-danger">{message}</div>}
        <button className="btn btn-primary" type="submit" disabled={paying}>
          {paying ? 'Processing...' : 'Pay Maintenance Fee'}
        </button>
      </form>

      <h5>Payment History</h5>
      {loading ? <p>Loading...</p> : (
        payments.length === 0 ? <p>No payments made yet.</p> :
          <table className="table table-striped">
            <thead>
              <tr>
                <th>Amount</th>
                <th>Month</th>
                <th>Receipt No.</th>
                <th>Paid At</th>
              </tr>
            </thead>
            <tbody>
              {payments.map(p => (
                <tr key={p._id}>
                  <td>â‚¹{p.amount.toFixed(2)}</td>
                  <td>{p.month}</td>
                  <td>{p.receiptNumber}</td>
                  <td>{new Date(p.paidAt).toLocaleString()}</td>
                </tr>
              ))}
            </tbody>
          </table>
      )}
    </div>
  );
}
